(105, '2016-05-29 16:05:57', '2016-05-29 16:05:57', 'S0004', 'Серьги Диор', 'app_data/app_images/20160523_023836_076093_p1.jpg', '', '', 3, 1, 'Серьги новый стиль от Диор', 'Серьги с жемчугом. Красивые серьги с жемчугом завораживают своей нежностью и магическим блеском. В ювелирной коллекции Мэрилин Монро, Коко Шанель, принцессы Дианы и других знаменитых женщин серьги с жемчугом занимали особое место. Сегодня модные серьги с жемчугом можно встретить и на юной моднице, и на зрелой даме. Серьги смотрятся очень эффектно.', '100.00', '1', 1, '1', '0', '1', '', 4, 10, 0, 0, 6, 0, 0, 0, 0, 0),
